//*********************** MESSAGES ***********************

var portal_url = 'http://aluno.ufabc.edu.br';

window.addEventListener('message', receiveMessage, false);

function receiveMessage(event)
{
    console.log('Mensagem recebida.');
    console.log('Origem: ' + event.origin);
    if (event.origin !== 'http://aluno.ufabc.edu.br')
    {
        console.log('Site desconhecido.');
        return;
    }
    console.log('Site conhecido.');
    if (event.data == 'Done')
        console.log('Mensagem de concluso recebido.');
    else if (event.data == 'Page opened')
    {
        portal.postMessage('Done', event.origin);
        console.log('Mensagem de concluso enviada.');
        clearInterval(timedMsg);
        console.log('Envio repetitivo de mensagem cancelado com sucesso.');
    }
    else
    {
        console.log('Carregado dados...');
        loadFromRaw(event.data);
        console.log('Dados recebidos com sucesso.');
        event.source.postMessage('Page opened', event.origin);
        console.log('Mensagem enviada ao remetente.');
        if (portal !== null)
        {
            portal = null;
            event.source.postMessage('Close page', event.origin);
            console.log('Mensagem enviada para fechar janela.');
        }
    }
}

function sendIntervalMessage()
{
    portal.postMessage('GetData', portal_url);
    console.log('Solicitao eviada ao portal.');
}

//*********************** COMMANDS ***********************

var timedMsg;

function openPortal()
{
    var portal = window.open(portal_url, 'portal', 'width=1178,height=415');
    portal.focus();
    startIntervalMessages();
}

function startIntervalMessages()
{
    timedMsg = setInterval(sendIntervalMessage, 1000);
    console.log('Envio repetitivo de mensagem iniciado.');
}

function stopIntervalMessages()
{
    if (timedMsg !== null && timedMsg !== undefined)
    {
        clearInterval(timedMsg);
        timedMsg == null;
        console.log('Envio repetitivo de mensagem cancelado com sucesso.');
    }
}